/**
Get the name and version of a macOS release from the Darwin version.

@param release - By default the current operating system is used, but you can supply a custom [Darwin kernel version](http://en.wikipedia.org/wiki/Darwin_%28operating_system%29#Release_history), which is the output of [`os.release()`](http://nodejs.org/api/os.html#os_os_release).
*/
export default function macosRelease(release?: string): string;
